// 競技場オートコンプリート
function setupTrackAutocomplete() {
  const input = document.getElementById('track');
  const dropdown = document.getElementById('track-dropdown');

  input.addEventListener('input', () => {
    const query = input.value.trim();
    if (query.length < 1) {
      dropdown.style.display = 'none';
      return;
    }
    const matches = trackList.filter(t => t.includes(query)).slice(0, 10);
    if (matches.length === 0) {
      dropdown.style.display = 'none';
    } else {
      dropdown.innerHTML = matches.map(t =>
        `<div class="dropdown-item" data-value="${t}">${t}</div>`
      ).join('');
      dropdown.querySelectorAll('.dropdown-item').forEach(item => {
        item.addEventListener('click', () => {
          input.value = item.dataset.value;
          dropdown.style.display = 'none';
        });
      });
      dropdown.style.display = 'block';
    }
  });

  input.addEventListener('blur', () => {
    setTimeout(() => dropdown.style.display = 'none', 200);
  });
}

